  name: string;
  datePosted: number;
  rating: number;
  reviewTitle: string;
  review: string;
}

interface DormPageData {
  dormName: string;
  reviewData: ReviewData[];
}
const DormPage: FC<DormPageData> = ({ dormName, reviewData}) => {
  const [data, setData] = useState();
